import React from "react";
import { FirstName } from "./App";
const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => {
          return (
            <>
              <LastName>
                {(lname) => {
                  return (
                    <h1>
                      this is {fname}
                      {lname}
                    </h1>
                  );
                }}
              </LastName>
            </>
          );
        }}
      </FirstName.Consumer>
    </>
  );
};
export default CompC;
